import styles from "./TransactionData.module.css";

const TransactionData = () => {
  return (
    <div className={styles.container}>
      <table>
        <tbody>
          <tr>
            <th>#</th>
            <th>Hotel</th>
            <th>Room</th>
            <th>Date</th>
            <th>Price</th>
            <th>Payment Method</th>
          </tr>
        </tbody>
      </table>
    </div>
  );
};
export default TransactionData;
